import React from 'react';
import { useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col, Button } from 'react-bootstrap';
import Footer from '../components/Footer.jsx';
import Feature from '../components/Feature';


function Home() {
  const navigate = useNavigate();

  const handlePractice = () => {
    navigate("/practice");
  };

  const handleInterview = () => {
    navigate("/interview");
  };

  return (

    <div>
      <section className="section section-header text-dark pb-md-8 mt-5">
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-12 col-md-10 text-center mb-5 mb-md-7">
            <h1 className="display-2 font-weight-bolder mb-4">
              面试陪练小助手
            </h1>
            <h2 className="mt-6 text-lg leading-8 text-gray-600"></h2>
            <p className="lead mb-4 mb-lg-5">🦁嗨!我是面小狮,你的面试小助理!</p>
            <p className="lead mb-4 mb-lg-5">我为你准备了各种面试题目和面试技巧，随时随地陪你练习!🤩 助你轻松考入心仪学校！🚀快来展现你的潜力，开始练习吧！💪 </p>
            <div>
              <Button variant="primary" className="mr-2" onClick={handlePractice}>题目练习</Button>
              <Button variant="danger" onClick={handleInterview}>模拟面试</Button>
              {/*  */}
              <a href="/quiz" className="btn btn-dark btn-download-app mb-xl-0 mr-2 mr-md-3">
                <span className="d-flex align-items-center">
                  {/* <span className="icon icon-brand mr-2 mr-md-3"><span className="fab fa-apple"></span></span> */}
                  <span className="d-inline-block text-left">
                    题目练习 
                  </span> 
                </span>
              </a>
              <a href="#" className="btn btn-dark btn-download-app">
                <span className="d-flex align-items-center">
                  {/* <span className="icon icon-brand mr-2 mr-md-3"><span className="fab fa-google-play"></span></span> */}
                  <span className="d-inline-block text-left">
                    面试模拟
                  </span> 
                </span>
              </a>
              {/*  */}

            </div>
          </div>
          <div className="col-12 col-md-10 justify-content-center">
            {/* d-none 小屏幕隐藏元素 */}
            <img className="d-md-inline-block" src="./static/assets/img/illustrations/scene.svg" alt="Mobile App Mockup" />
          </div>
        </div>
      </div>
    </section>
    <Container className="mt-5 pb-md-8">
      <Row className=''>
        <Col lg={7}>
          <div className="text-center text-lg-left">
            <div class="col-12 col-md-10 text-center mb-5 mb-md-7">

            <h1 className="display-3 mb-5 mt-5">面试陪练小助手</h1>
            {/* <h3 className="lead">——助你顺利通过升学面试</h3> */}
            <p >🤩 我是24小时陪你练习面试的小助手!😄</p>
            <p>📚 历年真题和模拟题一站式准备，轻松考入心仪学校！🚀</p>
            <p className="mb-5">💪 快来展现你的潜力，开始练习吧！💪</p>
            <div  className='mt-5'>
              <Button variant="primary" className="mr-2" onClick={handlePractice}>题目练习</Button>
              <Button variant="danger" onClick={handleInterview}>模拟面试</Button>
            </div>
            </div>
          </div>
        </Col>
        <Col lg={5}>
          <img src="/interview.png" alt="Image 1" className="img-fluid mt-4" />
        </Col>
      </Row>
    </Container>
    <div className='mt-5'><Feature/></div>
    <div className='mt-5'><Footer /></div>
    </div>
  );


}

export default Home;
